        /// <summary>
        /// 获取拼音,如果有字符没法转换,则直接显示
        /// </summary>
        /// <param name="input"></param>
        /// <param name="type"></param>
        /// <param name="split"></param>
        /// <returns></returns>
        private static string GetPinYin(string input, int type, string split)
        {
            init();
            string result = "";
            if (split != null && split != "")
            {
                int length = input.Length;
                bool isKey = true;
                for (int i = 0; i < length; i++)
                {
                    char key = input[i];
                    if (base_words.ContainsKey(key))
                    {
                        if (!isKey)
                        {
                            isKey = true;
                            result += split;
                        }
                        string[] s = base_words[key];
                        if (s != null)
                        {
                            if (i != length - 1)
                            {
                                result += s[type] + split;
                            }
                            else
                            {
                                result += s[type];
                            }
                        }
                    }
                    else
                    {
                        isKey = false;
                        result += key;
                    }
                }
            }
            else
            {
                foreach (char key in input)
                {
                    if (base_words.ContainsKey(key))
                    {
                        string[] s = base_words[key];
                        if (s != null)
                        {
                            result += s[type];
                        }
                    }
                    else
                    {
                        result += key;
                    }
                }
            }
            return result;
        }
        public static string ToPin1Yin1(string input)
        {
            return GetPinYin(input, type.带音调, null);
        }
        public static string ToPin1Yin1(string input, string split)
        {
            return GetPinYin(input, type.带音调, split);
        }

